@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix atm: <http://lod.csd.auth.gr/atm/atm.ttl#> .

atm:ATM a owl:Class .
atm:Account a owl:Class .
atm:Bank a owl:Class .
atm:CashCard a owl:Class .
atm:Customer a owl:Class .

atm:ownsCard a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:CashCard .

atm:belongsToBank a owl:ObjectProperty ;
    rdfs:domain atm:ATM ;
    rdfs:range atm:Bank .

atm:hasAccount a owl:ObjectProperty ;
    rdfs:domain atm:Customer ;
    rdfs:range atm:Account .

atm:cardIssuedBy a owl:ObjectProperty ;
    rdfs:domain atm:CashCard ;
    rdfs:range atm:Bank .

atm:Transaction a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
        owl:onProperty atm:belongsToBank ;
        owl:someValuesFrom atm:Bank ] .

atm:Message a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
        owl:onProperty atm:hasTransaction ;
        owl:someValuesFrom atm:Transaction ] .

atm:hasTransaction a owl:ObjectProperty ;
    rdfs:domain atm:Message ;
    rdfs:range atm:Transaction .

atm:Dispense a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
        owl:onProperty atm:belongsToATM ;
        owl:someValuesFrom atm:ATM ] .

atm:belongsToATM a owl:ObjectProperty ;
    rdfs:domain atm:Dispense ;
    rdfs:range atm:ATM .

atm:Money a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
        owl:onProperty atm:dispensedBy ;
        owl:someValuesFrom atm:Dispense ] .

atm:dispensedBy a owl:ObjectProperty ;
    rdfs:domain atm:Money ;
    rdfs:range atm:Dispense .

atm:Succeeded a owl:Class ;
    rdfs:subClassOf [ a owl:Restriction ;
        owl:onProperty atm:belongsToTransaction ;
        owl:someValuesFrom atm:Transaction ] .

atm:belongsToTransaction a owl:ObjectProperty ;
    rdfs:domain atm:Succeeded ;
    rdfs:range atm:Transaction .
